B.KV=new A.eu("eco","Eco Shop mobile app","UX/UI Design- Design System","This project was driven by my commitment to environmental sustainability. I believe that our consumption habits directly impact both the planet and our health, and this work was my contribution to that cause.\n\nThe goal of the design was to create a mobile app for the client's Eco shop that would meet the needs of their customers by providing a quick and efficient shopping experience.\n\nI applied the Design Thinking method throughout the entire process, from start to finish. UX research and usability testing played a central role in shaping the final product. Additionally, I developed a Design System with comprehensive guidelines to ensure a consistent and cohesive user interface.","cover.webp",B.df,B.ly,B.Gv,B.Fi,!1)
